import React, { useState, useEffect } from "react";
import { successModal, unsuccessModal } from "./Utility";

const Trade = ({ onAdd, updateCurrentCash, newCurrentCashValue }) => {
  const [trades, setTrades] = useState([]); // eslint-disable-next-line
  const [error, setError] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [formData, setFormData] = useState({
    symbol: "",
    option_type: "",
    strike_price: "",
    exp_date: "",
    entry_price: "",
    exit_price: "",
    contracts: "",
    entry_date: "",
    close_date: "",
    // profit_loss: "",
  });

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const fetchTrades = async () => {
    try {
      const response = await fetch("http://localhost:8000/trades");

      if (!response.ok) {
        throw new Error("Failed to fetch trades data");
      }
      const data = await response.json();
      console.log(data);
      setTrades(data.trades);
      successModal();
    } catch (error) {
      setError(error.message);
      unsuccessModal(error.message);
    }
  };

  useEffect(() => {
    fetchTrades();
  }, []);

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      const exitPrice =
        formData.exit_price === "" || formData.exit_price === null
          ? 0
          : formData.exit_price;

      const response = await fetch("http://localhost:8000/trades", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({ ...formData, exit_price: exitPrice }), // Send exit_price as 0 if empty
      });
      console.log(formData);
      if (!response.ok) {
        throw new Error("Failed to add Trade");
      }
      successModal();
      setShowModal(false);
      setFormData({
        symbol: "",
        option_type: "",
        strike_price: "",
        exp_date: "",
        entry_price: "",
        exit_price: "",
        contracts: "",
        entry_date: "",
        close_date: "",
      });
      fetchTrades();
      // // Call the onAdd function to update the trades list
      // const data = await response.json();
      // onAdd(data);
    } catch (error) {
      console.error("Error adding Trade:", error);
    }
  };

  return (
    <div className="trade">
      <div className="header">
        <p className="">Trades</p>
        <i
          className="fa-solid fa-plus"
          id="new-btn"
          onClick={() => setShowModal(true)}
        ></i>
      </div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Options</th>
            <th>Trade Date</th>
            <th>Settle Date</th>
            <th>Price</th>
            <th>Principle</th>
            <th>QTY</th>
            <th>Exit</th>
            <th>Net Amount</th>
            <th>P/L</th>
            <th>%</th>
          </tr>
        </thead>
        <tbody>
          {trades.map((trade) => (
            <tr key={trade[0]}>
              <td>{trade[0]}</td> {/* Trade ID */}
              <td>
                {trade[1]} {trade[2]} ${trade[3]}{" "}
                {trade[4].split("-").slice(1).join("/")}
              </td>
              {/* Symbol, Option Type, Strike Price */}
              <td>{trade[8].split("-").slice(1).join("/")}</td>
              {/* Trade Date */}
              <td>{trade[9].split("-").slice(1).join("/")}</td>
              {/* Settle Date */}
              <td>${trade[5]}</td> {/* Price */}
              <td>${(trade[5] * trade[7] * 100).toFixed(2)}</td>
              {/* Principle */}
              <td>{trade[7]}</td> {/* QTY */}
              <td>${trade[6]}</td> {/* Exit */}
              <td>
                {trade[6] && trade[7]
                  ? `$${(trade[6] * trade[7] * 100).toFixed(2)}`
                  : ""}
              </td>{" "}
              {/* Net Amount */}
              <td>
                {trade[10] && trade[7]
                  ? `$${(trade[10] * trade[7] * 100).toFixed(2)}`
                  : ""}
              </td>{" "}
              {/* P/L */}
              <td>
                {trade[10]
                  ? `${(((trade[6] - trade[5]) / trade[5]) * 100).toFixed(2)}%`
                  : ""}
              </td>{" "}
            </tr>
          ))}
        </tbody>
      </table>

      {showModal && (
        <div className="form-modal">
          <div className="form-modal-content">
            <div className="header"></div>
            <span className="close" onClick={() => setShowModal(false)}>
              &times;
            </span>
            <form className="new-trade-form" onSubmit={handleSubmit}>
              <label htmlFor="symbol">Symbol:</label>
              <input
                type="text"
                name="symbol"
                value={formData.symbol}
                onChange={handleChange}
              />

              <label htmlFor="option_type">Option Type:</label>
              <input
                type="text"
                name="option_type"
                value={formData.option_type}
                onChange={handleChange}
              />

              <label htmlFor="strike_price">Strike Price:</label>
              <input
                type="number"
                name="strike_price"
                value={formData.strike_price}
                onChange={handleChange}
              />

              <label htmlFor="exp_date">Expiration Date:</label>
              <input
                type="date"
                name="exp_date"
                value={formData.exp_date}
                onChange={handleChange}
              />

              <label htmlFor="entry_price">Entry Price:</label>
              <input
                type="number"
                name="entry_price"
                value={formData.entry_price}
                onChange={handleChange}
              />

              <label htmlFor="exit_price">Exit Price:</label>
              <input
                type="number"
                name="exit_price"
                value={formData.exit_price}
                onChange={handleChange}
              />

              <label htmlFor="contracts">Contracts:</label>
              <input
                type="number"
                name="contracts"
                value={formData.contracts}
                onChange={handleChange}
              />

              <label htmlFor="entry_date">Entry Date:</label>
              <input
                type="date"
                name="entry_date"
                value={formData.entry_date}
                onChange={handleChange}
              />

              <label htmlFor="close_date">Close Date:</label>
              <input
                type="date"
                name="close_date"
                value={formData.close_date}
                onChange={handleChange}
              />

              <label htmlFor="profit_loss">Profit/Loss:</label>
              <input
                type="number"
                name="profit_loss"
                value={formData.profit_loss}
                onChange={handleChange}
              />

              <button type="submit">Add Trade</button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
};

export default Trade;
